Join the DFL candidates for Minnesota‚Äôs 5th Congressional District seat to hear about issues of importance to the community and to the district.

 Confirmed participants as of July 9, 2018 include all of the DFL candidates for CD5: State Rep. Ilhan Omar, Fmr. Speaker Margaret Anderson Kelliher, State Sen. Patricia Torres Ray, Frank Drake, and Jamal Abdulahi.

 The forum is free and open to the public and to the media. Registration via the Eventbrite link is preferred.

 **Doors open at 6:15pm.**
 Please note the following important information:
 ¬∑ ASL interpretation will be available. Please ask an usher for priority seating for this accommodation;
 ¬∑ For safety and security purposes, all bags will be subject to search. If possible, please leave them in your car;
 ¬∑ T-shirts, stickers, or buttons worn on clothing are allowed;
 ¬∑ No signs or posters will be allowed inside the synagogue;
 ¬∑ Heckling, outbursts, or other disruptive behavior will not be permitted.

 We kindly ask all guests to please respect the sanctity of the synagogue by following these guidelines. If you have any questions or need accommodations in order to attend the forum, please contact Sami Rahamim at sami@minndakjcrc.org. Our goal is to be inclusive and welcoming to all.

 Thank you.
